import { useParams } from 'react-router-dom';
import Topbar from './Topbar/Topbar';
import './TournamentPage.css'

function TournamentPage() {
    let { t_id } = useParams();
    let { page } = useParams();
    let component = <PointsTable t_id = {t_id}/>
    switch(page) {
        case "pointstable":
            component = <PointsTable t_id = {t_id}/>
          break;
        case "bat_stats":
            component = <Scorecard m_id = {m_id} inn_no={inn_no}/>
          break;
        // case "fow":
        //     component = <Fow m_id = {m_id} inn_no={inn_no}/>
        //   break;
        // case "bowling_card":
        //     component = <BowlingCard m_id = {m_id} inn_no={inn_no}/>
        //   break;
        // case "partnerships":
        //     component = <Partnerships m_id = {m_id} inn_no={inn_no}/>
        //   break;
        // case "manhatten":
        //     component = <Manhatten m_id = {m_id} inn_no={inn_no}/>
        //   break;
        default:
            component = <PointsTable t_id = {t_id}/>
      }
    return ( 
        <div id="tournament_page">
            <div id="tournament_page_item1">
                <Topbar page={page} t_id={t_id}/>
            </div>
            <div id="tournament_page_item2">
                <div>
                    {component}
                </div>
            </div>

        </div>
        )

    }
export default TournamentPage;
